import React from 'react'

export default function Summary (props) {
  const f = { fontFamily: 'Patrick Hand' }
  return (
    <footer className='w3-container w3-pale-green'>
      <h4 style={f}>Summary</h4>
      <p style={f}>{props.sum}</p>
    </footer>
  )
}
